import { Link } from '@chakra-ui/react';
import Logo from './images/netflix.png'
import './App.css';

function App() {
  return (
    <div className="Navbar">
        <img src={Logo} alt='' className="max-w-xs"/>
        <div className="Menu">
        <Link href='#'>Home</Link>
        </div>
    </div>
  );
}

export default App;
